import React from 'react';
import { w3cwebsocket as W3CWebSocket } from 'websocket';
const client = new W3CWebSocket('ws://192.168.1.11:8000');

class AddOrder extends React.Component {
  state = {
    orders: [],
    newOrder: {}
  };

  handleOnChange = e => {
    const key = e.target.id;
    const data = e.target.value;
    this.setState(prevState => ({ newOrder: { ...prevState.newOrder, [key]: data } }));
  };

  handleOnSubmit = e => {
    e.preventDefault;
    this.setState(prevState => ({ orders: [...prevState.orders, this.state.newOrder] }));
  };

  render() {
    return (
      <div>
        <div className="row">
          <form
            className="col s12"
            onChange={e => this.handleOnChange(e)}
            onSubmit={e => this.handleOnSubmit(e)}
          >
            <div className="row">
              <div className="input-field col s3">
                <input id="orderCount" type="number" className="validate" />
                <label htmlFor="orderCount">Amount</label>
              </div>
              <div className="input-field col s9">
                <input id="orderItem" type="text" className="validate" />
                <label htmlFor="orderItem">Order Title</label>
              </div>
            </div>
            <button className="btn">Add Order</button>
          </form>
        </div>
      </div>
    );
  }
}

export default AddOrder;
